"use strict";

document.addEventListener('DOMContentLoaded',init);
let canvas = document.getElementById("scene");
let ctx = canvas.getContext("2d");
let particles = [];

let png = new Image();

function init() {
    png.onload = drawScene;

}


function drawScene() {
    canvas.width = png.width * 3;
    canvas.height = png.height * 3;

    ctx.drawImage(png, 0, 0);
    let data = ctx.getImageData(0,0, png.width, png.height);

    ctx.clearRect(0,0, canvas.width, canvas.height);

    for(let y = 0; y < data.width; y++ ){
        for(let x = 0; x < data.height; x++){
            let indexPixel = (x + y * data.width) * 4;
            if (data.data[indexPixel + 3] > 128){
                let particle = {
                    x0: x,
                    y0: y,
                    x1: png.width / 2,
                    y1: png.height / 2,
                    speed: Math.random() * 4 +2
                };

                TweenMax.to(particle, particle.speed, {
                    x1: particle.x0,
                    y1: particle.y0,
                    delay : y / 20,
                    ease: Elastic.easeOut
                });
                particles.push(particle)
            }
        }
    }
    requestAnimationFrame(render)
}

function render() {
    ctx.clearRect(0,0, canvas.width, canvas.height);
    for(let i = 0; i < particles.length; i++){
        ctx.fillRect(particles[i].x1 * 3, particles[i].y1 * 3, 2,2)
    }
    requestAnimationFrame(render)
}


png.src =
    "data:image/png;base64,\n";